import React from 'react'

class Sidebar extends React.Component{

  constructor(props, context) {
    super(props, context);
   
    this.state = {
      visible: false
    };
   
    this.toggleMenu = this.toggleMenu.bind(this);
  }
   
  toggleMenu() {
    this.setState({
        visible: !this.state.visible
    });
  }
  
  render () {
    return (
      <div width={ '20%' }>
        <div>
          <ul>
            <li>Lorem</li>
            <li>Ipsum</li>
            <li>Dolor</li>
            <li>Sit</li>
            <li>Bumblebees</li>
            <li>Aenean</li>
            <li>Consectetur</li>
          </ul>
        </div>
      </div>
      )
    }
}

export default Sidebar
